import {FilterState, FilterAction } from "./types";

const initialState: FilterState = {
    searchString: ''
}

export function filterReducer(state: FilterState = initialState, action: FilterAction) : FilterState {
        switch (action.type) {
            case "SEARCH_ACTION":
                return  state;
            default:
                return state;
        }
}
